import React, {Component} from 'react';
import Сontrollers from '../Сontrollers/Сontrollers'

export default class AirTemperature extends Component {
    constructor(props) {
        super(props)
        this.state = {
            temp:''
        };
    }
    componentDidMount() {
        Сontrollers.FetchOpenWeather(this.props.city)
    }
    render() {
        return(
            <div>{this.state.temp}</div>
        )
    }
}
